 (defn str-to-number[s]
   (Float/parseFloat s)
   )
 
 
 (def map-data (->> couscous
      (hc/derive-cols {:Mean [str-to-number :Mean]})
      (hc/rollup :Country hc/mean :Mean)
      (sc/mappify  {:header [:country :mean]})
       (sort-by :mean)
      (reverse)
      (hc/select-cols [:country :mean])
      
     ))
     
